    $('body').on('click','.do-upgrade',function () {
        var that = $(this);
        that.addClass('btn-progress');
        var plan = that.attr('data-plan');
        $.ymqajax({
            url: '/api/upgrade.html',
            data: {plan},
            isiziToast: false,
            success: function (res) {
                console.log(res);
                if(res.code == 1){
                    window.location.href=res.data;
                }else{
                    that.removeClass('btn-progress');
                }
            }
        });
    });
